{"version":3,"sources":["../../../../src/client/components/router-reducer/create-href-from-url.ts"],"sourcesContent":["export function createHrefFromUrl(
  url: Pick<URL, 'pathname' | 'search' | 'hash'>,
  includeHash: boolean = true
): string {
